graphql.query:
query DemoQuery1($input: ProfilesIndividualsQueryArgumentsType!) {
     profilesIndividuals(input: $input) @stream{
        profileAllInformationDetails{
            guestProfileID
            displayName
        }
        profileMembershipDetails {
            enrollmentProperty
            membershipClass
            membershipID
            membershipType
            joinedDate
            expirationDate
        }
     }
}

query DemoQuery2($resvInput: BookingsReservationQueryArgumentsType!,
$profileInput: ProfilesIndividualsQueryArgumentsType!) {
     bookingsReservation(input: $resvInput) @stream(initialCount: 2){
        reservationDetails{
            guestFirstName
            arrivalDate
        }
     }

    profilesIndividuals(input: $profileInput) @stream{
        profileAllInformationDetails{
            guestProfileID
            displayName
        }
        profileMembershipDetails {
            enrollmentProperty
            membershipClass
            membershipID
            membershipType
            joinedDate
            expirationDate
        }
    }
}

query Query($input: ProfilesIndividualsQueryArgumentsType!) {
  profilesIndividuals(input: $input) @stream{
    profileAllInformationDetails {
      updateDate
      city
      country
      lastStay
      profileId
      profileType
      firstName
      guestLastName
    }
  }
}

